SELECT

FROM
TPAM_CUP_MCHT_INFO
WHERE CHNL_ID = '00' and EBAP_MCHT_STAT = '0'
and to_char(CRT_TM,'yyyymmddhh24miss') > #{beginTime,jdbcType=VARCHAR}
AND to_char(CRT_TM,'yyyymmddhh24miss') <= #{endTime,jdbcType=VARCHAR}

SELECT

FROM
TPAM_CUP_MCHT_INFO
WHERE CHNL_ID = '00' and  EBAP_MCHT_STAT = '0'
AND TO_CHAR(CRT_TM,'yyyymmddhh24miss') <= #{beginTime,jdbcType=VARCHAR}
AND  to_char(LAST_UPD_TM,'yyyymmddhh24miss') > #{beginTime,jdbcType=VARCHAR}
AND to_char(LAST_UPD_TM,'yyyymmddhh24miss') <= #{endTime,jdbcType=VARCHAR}
